import React from "react";

function Food(probs){
  return <h2>I like {probs.name}</h2>;
}

const foodLike = [
  {
    name : "kimchi"
  },
  {
    name : "banana"
  }
];

function App() {
  return (
  <div>
    <h1>Hi!</h1>
    {foodLike.map(dish => <Food name={dish.name} />)}
  </div>
  );
}

export default App;
